August Moon (2012) (digital-Empire) [By Diana Thung]

The townspeople of Calico believe in the legend of the Soul Fire, about orbs of light sometimes seen in the night sky, believed to be the souls of dead ancestors watching over the town. These &quot;fireballs&quot; are actually the light from the lanterns carried by mysterious creatures called The Rabbits. Under the cover of night, they leap across rooftops with Jaden, a peculiar street kid who, when asked about his home, simply points to the moon. Soon The Monkeys arrive in town to demolish the forest, and it falls on Jaden to protect Calico and The Rabbits. When eleven year-old Fi meets Jaden, she becomes entangled in Jaden's battle against The Monkeys. She is also introduced to a world of secrets and things that seems impossible.

